function startCalc(){
	var pokemonNodes = document.getElementsByClassName("pokemon-card");
	for (var iii = 0; iii < pokemonNodes.length; iii++) {
		var currCard = pokemonNodes[iii];
		var currPokeData = currCard.getElementsByClassName("hidden")[0].innerHTML.split("&nbsp;");
		var currLevel = "??";
		try{
			var currID = parseInt(currPokeData[0]);
			var currCP = parseInt(currPokeData[1]);
			var currATK = parseInt(currPokeData[2]);
			var currDEF= parseInt(currPokeData[3]);
			var currSTA = parseInt(currPokeData[4]);
			currLevel = getLevel(currID, currCP, currATK, currDEF, currSTA);
		}
		catch(err){
			console.err("error calculating level for node: " + iii);
		}
		finally{
			currCard.getElementsByClassName("level")[0].innerHTML = "Lv " + currLevel;
		}
	}
}

function getLevel(id, cp, atk, def, sta){
	var currPokemon = pokeDataJson[id];
	var baseAtk = currPokemon["BaseAttack"];
	var baseDef = currPokemon["BaseDefense"];
	var baseSta = currPokemon["BaseStamina"];
	var rhs = (baseAtk + atk)*Math.sqrt(baseDef + def)*Math.sqrt(baseSta + sta)*0.1;
	var currCpM = Math.sqrt((cp + 0.5)/rhs); //actual formula has floor(), doing the intermediate one
	var nearestCpM = tcpms.reduce(function(last, curr){
		return (Math.abs(curr - currCpM)< Math.abs(last - currCpM)? curr: last);
	});
	var index = tcpms.indexOf(nearestCpM);
	return (index+2)/2.0;
}